import logo from './logo.svg';
import React from "react" ;
import './App.css';
import Vue from 'vue';
import BlogPage from './BlogPage.vue';

new Vue({
  // ...
  components: {
    BlogPage,
  },
  // ...
}).$mount('#app');

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>hello</h1>
      </header>
    </div>
  );
}

export default App;
